import React from 'react';
import makeStyles from "@material-ui/core/styles/makeStyles";
import Iframe from "react-iframe";
import Grid from "@material-ui/core/Grid";
import Divider from "@material-ui/core/Divider";
import DualPane from "../utlilty/DualPane";
import InfoCard from "../utlilty/InfoCard";

const useStyles = makeStyles(theme => ({
    videos: {
        justifyContent: 'space-evenly'
    },
    grid_text: {
        padding: 20
    }
}));

export default function Piano() {
    const classes = useStyles();
    return (
        <div>
            <DualPane url1="https://www.youtube.com/embed/t8JY5fZ5b4A"
                      url2="https://www.youtube.com/embed/EZlQcX_DsuE"/>
            <Grid className={classes.grid_text} container justify="space-evenly" spacing={3}>
                <Grid item xs={7}>
                    <InfoCard>
                        <ul>
                            <li> Started learning at age of 12.</li>
                            <li> Mainly self-taught (acoustic and electric), with initial guidance from my older
                                brother.
                            </li>
                            <li> Stemmed from an interest in <i>Classic Rock</i>, but have now
                                taken interest in other areas like <i> Gypsy Jazz, 70s Rock, and Blues </i></li>
                        </ul>
                    </InfoCard>
                </Grid>
                <Grid item xs={5}>
                    <InfoCard anec>
                        I am primarily a right-hander but play a <i><b>left-handed guitar</b></i>!<br/>
                        My older brother was a left-hander, and we had a left-handed guitar at home.
                        I subconsciously picked up the guitar as a lefty for the first time. It was
                        not till later that I realized, but I decided not to change!
                    </InfoCard>
                </Grid>
            </Grid>
        </div>
    );
}
